import React from 'react';
import { Route, Link } from 'react-router-dom'
import axios from 'axios';

const AnimeList = ({animes, deleteAnime}) => {
  const deleteBtnClickHandler =(_id) => {
    axios.delete('http://localhost:8000/anime/' + _id)
    .then(res => {
      deleteAnime(_id);
      alert('deleted')
    })
  }
    return (
      <div>
         <tr>
         {
                animes.map( anime =>
                    <div key={anime._id}> 
                      <img src={anime.image} alt={anime.title} width="100px" />
                        <span>{anime.title} Price: {anime.rating}</span>  
                        <button onClick={()=>{deleteBtnClickHandler(anime._id)}}> x </button>
                        <Link to={'/items/edit/' + anime._id}>
                            <button >Edit Item</button>
                        </Link>
                    </div>
                    )
            }
      </tr>
      </div>



    )
}

export default AnimeList;
